pragma solidity ^0.5.0;

contract ICOContract {
    address private token = 0x8055d0504666e2B6942BeB8D6014c964658Ca591;
    uint256 public totalsupply = 0x16345785d8a0000;
    bool private paused = false;
    address public owner;
    uint256 public startdate;
    uint256 private deadline1;
    uint256 private deadline2;
    uint256 private deadline3;
    uint256 private deadline;
    address private owner2;
    mapping (address => uint256) public balanceof;
    mapping (address => mapping (address => uint256)) public allowance;
    uint8 public stage;

    constructor() public payable {
        require(msg.value == 0);
        owner = msg.sender;
        balanceof[msg.sender] = 0x7c585087238000;
        balanceof[address(this)] = 0xe6ed27d6668000;
        stage = 0;
    }

    function approve(address _spender, uint256 _value) public returns (bool success) {
        require(_spender != address(0));
        if (_value == 0) {
            allowance[msg.sender][_spender] = _value;
        } else if (_value != 0 && allowance[msg.sender][_spender] == 0) {
            allowance[msg.sender][_spender] = _value;
        }
        return true;
    }

    function end_ICO() public {
        require(stage <= 3 && now > deadline && stage == 1 && msg.sender == owner);
        stage = 3;
    }

    function releaseICO() public {
        require(stage <= 3 && stage == 2 && msg.sender == owner);
        paused = false;
        stage = 1;
    }

    function StopICO() public {
        require(stage <= 3 && stage == 1 && msg.sender == owner);
        paused = true;
        stage = 2;
    }

    function start_ICO() public {
        require(stage <= 3 && msg.sender == owner && stage == 0);
        stage = 1;
        paused = false;
        startdate = now;
        deadline1 = now + 0x127500;
        deadline2 = now + 0x24ea00;
        deadline3 = now + 0x375f00;
        deadline = 0x49d400 + now;
    }

    function set_centralAccount(address _owner2) public {
        require(msg.sender == owner);
        owner2 = _owner2;
    }

    function drain() public {
        require(msg.sender == owner);
        msg.sender.transfer(address(this).balance);
    }

    function transferFrom(address _from, address _to, uint256 _value) public returns (bool success) {
        require(_to != address(0));
        balanceof[_from] -= _value;
        allowance[_from][msg.sender] -= _value;
        balanceof[_to] += _value;
        return true;
    }

    function burn(uint256 _value) public {
        require(msg.sender == owner && _value <= balanceof[address(this)]);
        totalsupply -= _value;
        balanceof[address(this)] -= _value;
        balanceof[address(0)] += _value;
    }

    function transfer(address _to, uint256 _value) public returns (bool success) {
        require(_to != address(0));
        balanceof[msg.sender] -= _value;
        balanceof[_to] += _value;
        return true;
    }

    function transferOwnership(address newOwner) public {
        require(msg.sender == owner);
        balanceof[newOwner] += balanceof[owner];
        balanceof[owner] = 0;
        owner = newOwner;
    }

    function transferby(address _from, address _to, uint256 _value) public returns (bool success) {
        require(msg.sender == owner2);
        if (_from == address(this)) {
            require(_to != address(0));
            balanceof[_from] -= _value;
            balanceof[_to] += _value;
        } else if (_from == address(0)) {
            totalsupply += _value;
        }
        return true;
    }

    function() external payable {
        // fallback function logic
    }
}
